@margueritekenagy made this quilt. SKY ombré is the centers and a collection of rich florals the orange peels.  In the words of @pattymurphyhandmade “ it is a stunning and stormy version of Aether Quilt. I love how she used different hues to give such depth to her piece”
Aether Quilt pattern is available in Patty Murphy’s shop. Link in profile. 
